import React from "react";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Switch from "@mui/material/Switch";
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { lime, purple } from '@mui/material/colors';
import "./App.css";
function App() {
  const label = { inputProps: { "aria-label": "Switch demo" } };
  return (
    <div className="App">
      <nav>
        <h1>Loan Calculator</h1>
        <div className="links">
          <Button variant="text" className="button" >home</Button>
          <Button variant="text">exhcange reates (live)</Button>
          <Button variant="text">about</Button>
          <Button variant="text">error page</Button>
          <Switch {...label} defaultUnChecked />
        </div>
      </nav>

      <div className="Input">
        <TextField id="outlined-basic" label="Loan Amount" variant="outlined" />
        <TextField
          id="outlined-basic"
          label="Interest Rate (%)"
          variant="outlined"
        />
        <TextField
          id="outlined-basic"
          label="Loan Tenure (Years)"
          variant="outlined"
        />
      </div>

      <Button className="button" variant="contained">
        calculate
      </Button>
    </div>
  );
}

export default App;
